import React from 'react';
import { Link } from 'react-router-dom';
import './styles/NotFound.css';
import BackgroundImage from '../images/pAGEnotFound.png';


class NotFound extends React.Component {
    render() {
      return (
        <div className="Bknd">
        <div className="container">
          <div className="row">


            <div className="Bknd__col d-none d-md-block col-md-8">
              <img
                src={BackgroundImage}
                alt="Astronauts"
                className="img-fluid p-4"
              />
            </div>
          </div>
        </div>
      </div>
      );
    }
  }

export default NotFound;
